CREATE TABLE eclipse_lunaire(id_eclipse_lunaire INT PRIMARY KEY,Quincena_Solar_Eclipse VARCHAR(10),Penumbral_Eclipse_Duration_m VARCHAR(10),Partial_Eclipse_Duration_m DOUBLE,Total_Eclipse_Duration_m DOUBLE,id_phénomene INT,id_localisation INT,type_eclipse INT,id_date INT, FOREIGN KEY (id_phénomene) REFERENCES phenomenes(id_phénomene), FOREIGN KEY (id_localisation) REFERENCES localisation(id_local), FOREIGN KEY (type_eclipse) REFERENCES type_eclipse(id_eclipse), FOREIGN KEY (id_date) REFERENCES date(id_date));
